import { Container, Row } from "reactstrap";
import "./App.css";
import Documents from "./Documents";
import Projects from "./Projects";
import Tasks from "./Tasks";

function App() {
  return(
    <div>
      <Container>
        <Row>
            <Tasks/>
        </Row>
        <Row>
            <Projects/>
            <br></br>
            <Documents/>
        </Row>
      </Container>
    </div>
  );
}

export default App;
